import React, {Component} from 'react';
import img_background from './images/daytoner2.jpg';

class Marketplace extends Component {
	constructor(props){
		super(props);
		this.state = {
		lot: []
		}
	}

	componentDidlMount(){
		fetch('/api/lot')
		.then(data => data.json())
		.then(lot => this.setState({lot}));
	}

	render(){
		return(
			<div>
				<img src={img_background} alt=""/>
		
				<h1> Marketplace </h1>
			</div>
		)
	}
}
export default Marketplace;
